/* Tables */
CREATE TABLE IF NOT EXISTS norm_ionization /* Normalization table for mass spectrometer ionization source types */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* validation list of ionization source names */ acronym TEXT NOT NULL UNIQUE /* validation list of ionization source acronyms */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_solvents /* Mobile phase solvent list: controlled. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* IUPAC name for mobile phase norm_solvents */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_additives /* Solvent additives list: controlled. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* IUPAC name for solvent additives */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_vendors /* Normalization table holding commercial instrument vendor information. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* company name */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_qc_methods_reference /* Normalization table for quality control reference types. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* type of QC reference */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_qc_methods_name /* Normalization table for quality control types. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* type of QC method */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_ce_desc /* Normalization table for collision energy description. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* type of CE */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_ce_units /* Normalization table for collision energy units. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* collision energy units */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_ionization_units /* Normalization table for ionization energy units. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* ionization energy units */ acronym TEXT NOT NULL UNIQUE /* ionization energy units acronym */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_ms_types /* Normalization table for mass spectrometer types. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* type of the mass analyzer */ acronym TEXT NOT NULL UNIQUE /* common acronym for the mass spectrometer type */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_ms_n_types /* Normalization table for types of ms_n experiments. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* type of the mass analyzer */ acronym TEXT NOT NULL UNIQUE /* common acronym for the mass spectrometer type */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_fragmentation_types /* Normalization table for fragmentation type. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* type of fragmentation */ acronym TEXT NOT NULL UNIQUE /* common acronym for the fragmentation type */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_polarity_types /* Normalization table for ionization polarity. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* type of the polarity, controlled vocabulary */ /* Check constraints */ CHECK (name IN ('negative', 'positive', 'negative/positive')) /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_chromatography_types /* Normalization table for chromatography types. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE, /* type of chromatography */ acronym TEXT NOT NULL UNIQUE /* common acronym for chromatographic type (e.g. LC, GC) */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_column_chemistries /* Normalization table for chromatographic column type. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* column chemistry used */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS norm_column_positions /* Normalization table for chromatographic column position */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* column position name */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS solvent_mix_collections /* An intermediary identification table linking mobile_phases and solvent_mixes */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ name TEXT NOT NULL UNIQUE /* short hand name of the mixture */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS mobile_phases /* Description of mobile phases used during a chromatographic separation. */ ( methods_id INTEGER NOT NULL, /* foreign key to methods */ carrier INTEGER NOT NULL, /* informal foreign key to solvent_mixes */ additive1_id INTEGER, /* buffer/salt/acid addition to mobile phase; foreign key to norm_additives */ additive2_id INTEGER, /* buffer/salt/acid addition to mobile phase; foreign key to norm_additives */ additive3_id INTEGER, /* buffer/salt/acid addition to mobile phase; foreign key to norm_additives */ duration REAL, /* time duration mobile phase was applied */ duration_units TEXT DEFAULT "minutes", /* time duration units, constrained to one of "second" or "minutes" */ /* Check constraints */ CHECK (duration_units IN ("seconds", "minutes")), CHECK (duration > 0), /* Foreign key relationships */ FOREIGN KEY (methods_id) REFERENCES ms_methods(id) ON UPDATE CASCADE, FOREIGN KEY (additive1_id) REFERENCES norm_additives(id) ON UPDATE CASCADE, FOREIGN KEY (additive2_id) REFERENCES norm_additives(id) ON UPDATE CASCADE, FOREIGN KEY (additive3_id) REFERENCES norm_additives(id) ON UPDATE CASCADE, FOREIGN KEY (carrier) REFERENCES solvent_mix_collections(id) ON UPDATE CASCADE );
CREATE TABLE IF NOT EXISTS ms_descriptions /* Full description of all mass spectrometer types used for a given entry in ms_methods. */ ( ms_methods_id INTEGER NOT NULL, /* foreign key to ms_methods */ ms_types_id INTEGER NOT NULL, /* foreign key to norm_ms_types */ vendor_id INTEGER NOT NULL, /* foreign key to norm_vendors */ /* Check constraints */ UNIQUE(ms_methods_id, ms_types_id, vendor_id), /* Foreign key relationships */ FOREIGN KEY (ms_methods_id) REFERENCES ms_methods(id) ON UPDATE CASCADE ON DELETE CASCADE, FOREIGN KEY (ms_types_id) REFERENCES norm_ms_types(id) ON UPDATE CASCADE ON DELETE CASCADE, FOREIGN KEY (vendor_id) REFERENCES norm_vendors(id) ON UPDATE CASCADE ON DELETE CASCADE );
CREATE TABLE IF NOT EXISTS chromatography_descriptions /* Full description of all chromatography types used for a given entry in ms_methods. */ ( ms_methods_id INTEGER NOT NULL, /* foreign key to ms_methods */ chromatography_types_id INTEGER NOT NULL, /* foreign key to norm_ms_types */ column_chemistry_id INTEGER NOT NULL, /* foreign key to norm_column_chemistries */ column_position_id INTEGER NOT NULL, /* foreign key to norm_column_positions */ vendor_id INTEGER NOT NULL, /* foreign key to norm_vendors */ /* Check constraints */ UNIQUE(ms_methods_id, chromatography_types_id, column_chemistry_id, column_position_id, vendor_id), /* Foreign key relationships */ FOREIGN KEY (ms_methods_id) REFERENCES ms_methods(id) ON UPDATE CASCADE, FOREIGN KEY (column_chemistry_id) REFERENCES norm_column_chemistries(id) ON UPDATE CASCADE ON DELETE CASCADE, FOREIGN KEY (chromatography_types_id) REFERENCES norm_chromatography_types(id) ON UPDATE CASCADE ON DELETE CASCADE FOREIGN KEY (column_position_id) REFERENCES norm_column_positions(id) ON UPDATE CASCADE ON DELETE CASCADE, FOREIGN KEY (vendor_id) REFERENCES norm_vendors(id) ON UPDATE CASCADE ON DELETE CASCADE );
CREATE TABLE IF NOT EXISTS ms_methods /* Mass spectrometer method settings. */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ ionization INTEGER, /* ionization mode (ESI, APCI, EI, etc.); foreign key to norm_ionization */ voltage REAL, /* ionization voltage/current (depending on mode) */ voltage_units INTEGER, /* foreign key to norm_ionization_units */ polarity INTEGER NOT NULL, /* ionization polarity (negative, positive, or negative/positive); foreign key to norm_polarity */ ce_value TEXT, /* value for collision energy, normally a number but can be a range */ ce_units INTEGER NOT NULL, /* collision energy units; foreign key to norm_ce_units */ ce_desc INTEGER NOT NULL, /* description/context of the collision energy value (normalized, stepped, range, etc.); foreign key to norm_ce_desc */ fragmentation INTEGER NOT NULL, /* fragmentation type; foreign key to norm_fragmentation_types */ ms2_type INTEGER, /* type of data acquisition for MS2 experiment; foreign key to norm_ms_n_types */ has_qc_method INTEGER NOT NULL, /* constrained to (0, 1) boolean: does the experiment have a QC method in place */ citation TEXT, /* citation for the experimental method */ /* Check constraints */ CHECK (has_qc_method IN (0, 1)) /* Foreign key relationships */ FOREIGN KEY (ionization) REFERENCES norm_ionization(id) ON UPDATE CASCADE, FOREIGN KEY (voltage_units) REFERENCES norm_ionization_units(id) ON UPDATE CASCADE, FOREIGN KEY (polarity) REFERENCES norm_polarity_types(id) ON UPDATE CASCADE, FOREIGN KEY (ce_desc) REFERENCES norm_ce_desc(id) ON UPDATE CASCADE, FOREIGN KEY (ce_units) REFERENCES norm_ce_units(id) ON UPDATE CASCADE, FOREIGN KEY (fragmentation) REFERENCES norm_fragmentation_types(id) ON UPDATE CASCADE, FOREIGN KEY (ms2_type) REFERENCES norm_ms_n_types(id) ON UPDATE CASCADE );
CREATE TABLE IF NOT EXISTS conversion_software_linkage /* Linkage table keeping conversion software setting id groupings in line. These IDs are used to link tables conversion_software_settings and samples. This must be incremented prior to adding new rows in conversion_software_settings, and the new ID used in both conversion_software_settings(id) and samples(software_conversion_settings_id). */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* automatically populated with each call to keep settings together */ ts REAL NOT NULL DEFAULT -999 /* timestamp to ensure referential integrity during import, -999 indicates that settings were not provided */ /* Check constraints */ /* Foreign key relationships */ );
CREATE TABLE IF NOT EXISTS conversion_software_settings /* Settings specific to the software package used to preprocess raw data. */ ( linkage_id INTEGER, /* foreign key to msconvert_settings_linkage */ setting_value TEXT NOT NULL, /* value of the software setting */ /* Check constraints */ /* Foreign key relationships */ FOREIGN KEY (linkage_id) REFERENCES conversion_software_linkage(id) );
CREATE TABLE IF NOT EXISTS qc_methods /* References to quality control (QC) methods used to vet experimental results */ ( id INTEGER PRIMARY KEY AUTOINCREMENT, /* primary key */ ms_methods_id INTEGER NOT NULL, /* foreign key to ms_methods */ name INTEGER NOT NULL, /* the type of QC performed; controlled vocabulary must be one of "Mass Analyzer Calibration", "External Standard Verification", "Internal Standard Verification", or "Matrix Standard Verification" */ reference INTEGER NOT NULL, /* the category of the QC method; controlled vocabulary must be one of "SOP (Internal)", "SOP (External/Published)", or "Manuscript" */ reference_text TEXT, /* free text entry pointing to a description of the QC method, whether a DOI, SOP reference, or manual description */ /* Check constraints */ /* Foreign key relationships */ FOREIGN KEY (ms_methods_id) REFERENCES ms_methods(id) ON UPDATE CASCADE, FOREIGN KEY (name) REFERENCES norm_qc_methods_name(id) ON UPDATE CASCADE DEFERRABLE INITIALLY DEFERRED, FOREIGN KEY (reference) REFERENCES norm_qc_methods_reference(id) ON UPDATE CASCADE DEFERRABLE INITIALLY DEFERRED );
CREATE TABLE IF NOT EXISTS solvent_aliases /* List of common aliases for each entry in TABLE norm_solvents */ ( solvent_id INTEGER NOT NULL, /* foreign key to norm_solvents */ alias TEXT NOT NULL UNIQUE, /* human meaningful name(s) associated with a solvent */ /* Check constraints */ /* Foreign key relationships */ FOREIGN KEY (solvent_id) REFERENCES norm_solvents(id) ON UPDATE CASCADE DEFERRABLE INITIALLY DEFERRED );
CREATE TABLE IF NOT EXISTS additive_aliases /* List of common aliases for each entry in norm_additives */ ( additive_id INTEGER NOT NULL, /* foreign key to norm_solvents */ alias TEXT NOT NULL UNIQUE, /* human meaningful name(s) associated with an additive */ /* Check constraints */ /* Foreign key relationships */ FOREIGN KEY (additive_id) REFERENCES norm_additives(id) ON UPDATE CASCADE DEFERRABLE INITIALLY DEFERRED );
CREATE TABLE IF NOT EXISTS solvent_mixes /* Mobile phase solvent mixture for a given elution method */ ( mix_id INTEGER NOT NULL, /* mixture identifier to gather discrete components; foreign key to solvent_mix_collections */ component INTEGER NOT NULL, /* foreign key to solvent_fractions */ fraction REAL NOT NULL, /* amount fraction amount of this solvent in the mixture, contrained from 0 - 1 */ /* Check constraints */ CHECK (fraction BETWEEN 0 AND 1), /* Foreign key relationships */ FOREIGN KEY (mix_id) REFERENCES solvent_mix_collections(id) ON UPDATE CASCADE, FOREIGN KEY (component) REFERENCES norm_solvents(id) ON UPDATE CASCADE );
/* Data */
/* Normalization tables should be populated as appropriate for the project. Examples are given in "config/data" directory and may be imported from there or by running "config/demo_data.sql" */
/* Views */
CREATE VIEW IF NOT EXISTS view_mass_analyzers AS /* View all mass analyzers used in methods */ SELECT msd.ms_methods_id, /* mass spectrometric method id */ ms.acronym, /* mass spectrometer acronym */ ms.name /* mass spectrometer type used in this method */ FROM ms_descriptions msd INNER JOIN norm_ms_types ms ON ms.id = msd.ms_types_id;
CREATE VIEW IF NOT EXISTS view_chromatography_types AS /* View all chromatography types in methods */ SELECT cd.ms_methods_id, /* mass spec method id */ nct.acronym, /* chromatographic type acronym */ nct.name /* chromatographic type used in this method */ FROM chromatography_descriptions cd INNER JOIN norm_chromatography_types nct ON nct.id = cd.chromatography_types_id;
CREATE VIEW IF NOT EXISTS view_mobile_phase AS /* View complete mobile phase used in a mixture */ SELECT sm.mix_id, /* solvent mix id */ s.name AS solvent, /* solvent name */ sm.fraction /* solvent fraction in this mix */ FROM solvent_mixes sm INNER JOIN norm_solvents s ON s.id = sm.component;
CREATE VIEW IF NOT EXISTS view_detectors AS /* Convenience view to build view_method_as by providing a single character string for detectors used in this method */ SELECT msd.ms_methods_id, /* ms_descriptions id */ REPLACE(group_concat(name), ",", " ") AS "detectors" /* concatenated list of detectors */ FROM ms_descriptions msd JOIN norm_ms_types nmt ON msd.ms_types_id = nmt.id GROUP BY msd.ms_methods_id;
CREATE VIEW IF NOT EXISTS view_column_chemistries AS /* Convenience view to build view_method_as by providing a single character string for column chemistries used in this method */ SELECT cd.ms_methods_id, /* ms_descriptions id */ REPLACE(group_concat(DISTINCT(ncc.name || " " || ncp.name || " column")), ",", ' with ') AS "columns" /* concatenated list of column chemistries used */ FROM chromatography_descriptions cd JOIN norm_column_positions ncp ON cd.column_position_id = ncp.id JOIN norm_column_chemistries ncc ON cd.column_chemistry_id = ncc.id GROUP BY cd.ms_methods_id;
CREATE VIEW IF NOT EXISTS view_separation_types AS /* Convenience view to build view_method_as by providing a single character string for chromatography type */ SELECT cd.ms_methods_id, /* chromatography_descriptions id */ REPLACE(GROUP_CONCAT(DISTINCT(nv.name)), ",", " x ") AS "chrom_vendor", /* chromatography system vendor */ REPLACE(GROUP_CONCAT(DISTINCT(ct.acronym)), ",", " x ") AS "chrom_type" /* chromatography type (e.g. LC, GC, etc.) */ FROM chromatography_descriptions cd LEFT JOIN norm_chromatography_types ct ON cd.chromatography_types_id = ct.id LEFT JOIN norm_vendors nv ON cd.vendor_id = nv.id GROUP BY cd.ms_methods_id;
CREATE VIEW IF NOT EXISTS view_method AS /* View mass spectrometer information and method settings */ SELECT msm.id, /* Method id */ vst.chrom_vendor AS "chromatography_system_vendor", /* Chromatograhic system vendor */ vst.chrom_type AS "chromatographic_type", /* Chromatographic separation type name */ nv.name AS "mass_spectrometer_vendor", /* Vendor name */ vd.detectors AS "detector", /* Mass spectrometer type */ vcc.columns AS "columns", /* Chromatographic columns used in this method */ nft.acronym AS "fragmentation_acronym", /* Mass spectrometer fragmentation type acronym */ nft.name AS "fragmentation_name", /* Mass spectrometer fragmentation type */ pt.name AS "polarity", /* Polarity setting */ ni.acronym AS "ionization", /* Ionization type */ msm.voltage || " " || niu.name AS "voltage", /* Ionization energy */ msm.ce_value|| " " || niu.name AS "collision_energy", /* Collision energy in electron volts */ ncd.name AS "collision_energy_description" /* Collision energy description */ FROM ms_methods msm LEFT JOIN norm_ionization ni ON msm.ionization = ni.id LEFT JOIN ms_descriptions msd ON msm.id = msd.ms_methods_id LEFT JOIN norm_vendors nv ON msd.vendor_id = nv.id LEFT JOIN view_detectors vd ON msm.id = vd.ms_methods_id LEFT JOIN norm_polarity_types pt ON pt.id = msm.polarity LEFT JOIN chromatography_descriptions cd ON msm.id = cd.ms_methods_id LEFT JOIN view_separation_types vst ON msm.id = vst.ms_methods_id LEFT JOIN view_column_chemistries vcc ON msm.id = vcc.ms_methods_id LEFT JOIN norm_ionization_units niu ON msm.voltage_units = niu.id LEFT JOIN norm_ce_units ncu ON msm.ce_units = ncu.id LEFT JOIN norm_fragmentation_types nft ON msm.fragmentation = nft.id LEFT JOIN norm_ce_desc ncd ON msm.ce_desc = ncd.id GROUP BY msm.id;
CREATE VIEW IF NOT EXISTS view_method_narrative AS /* Collapses the contents of view_method into a single narrative string by ID */ SELECT id AS "Method ID", /* primary key */ "Measured by " || chromatographic_type || " (" || chromatography_system_vendor || ") " || detector || " MS (" || mass_spectrometer_vendor || "), separated by " || columns || " in " || polarity || " " || ionization || " mode at " || voltage || " and " || collision_energy_description || " fragmentation by " || fragmentation_acronym || " (" || fragmentation_name || ")" || " at " || collision_energy || "." AS "Narrative" /* narrative string collapsed into readable form from view_method */ FROM view_method;
